import React, { useState, useEffect } from "react";
import { getAllPatients, registerPatient } from "../services/patientService";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();
  const [patients, setPatients] = useState([]);
  const [formData, setFormData] = useState({
    name: "",
    age: "",
    gender: "Male",
    address: "",
    contact: "",
    wardNumber: "",
    status: "Admitted",
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const token = localStorage.getItem("token");

  useEffect(() => {
    if (!token) {
      navigate("/login"); // Redirect if token is missing
    } else {
      fetchPatients();
    }
  }, [token, navigate]);

  const fetchPatients = async () => {
    setLoading(true);
    setError("");
    try {
      if (!token) throw new Error("Unauthorized. Please log in.");
      const data = await getAllPatients(token);
      if (Array.isArray(data)) {
        setPatients(data);
      } else {
        throw new Error("Invalid API response");
      }
    } catch (error) {
      setError(error.message || "Failed to load patients.");
    } finally {
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    try {
      await registerPatient(formData, token);
      alert("Patient registered successfully!");
      fetchPatients();
    } catch (error) {
      setError(error.message || "Registration failed.");
    }
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center">Admin Dashboard</h2>

      {error && <div className="alert alert-danger">{error}</div>}

      <div className="card p-4 shadow-sm">
        <h3>Register a Patient</h3>
        <form onSubmit={handleSubmit}>
          <input type="text" name="name" placeholder="Name" className="form-control mb-2" onChange={handleChange} required />
          <input type="number" name="age" placeholder="Age" className="form-control mb-2" onChange={handleChange} required />
          <select name="gender" className="form-select mb-2" onChange={handleChange}>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
          <input type="text" name="address" placeholder="Address" className="form-control mb-2" onChange={handleChange} required />
          <input type="text" name="contact" placeholder="Contact" className="form-control mb-2" onChange={handleChange} required />
          <input type="text" name="wardNumber" placeholder="Ward Number" className="form-control mb-2" onChange={handleChange} required />
          <select name="status" className="form-select mb-3" onChange={handleChange}>
            <option value="Admitted">Admitted</option>
            <option value="Discharged">Discharged</option>
          </select>
          <button type="submit" className="btn btn-primary w-100" disabled={loading}>
            {loading ? "Registering..." : "Register Patient"}
          </button>
        </form>
      </div>

      <h3 className="mt-5">Registered Patients</h3>
      {loading ? (
        <p>Loading patients...</p>
      ) : (
        <table className="table table-bordered mt-3">
          <thead className="table-primary">
            <tr>
              <th>Name</th>
              <th>Age</th>
              <th>Gender</th>
              <th>Address</th>
              <th>Contact</th>
              <th>Ward</th>
              <th>Status</th>
              <th>Registered At</th>
            </tr>
          </thead>
          <tbody>
            {patients.length > 0 ? (
              patients.map((patient) => (
                <tr key={patient._id}>
                  <td>{patient.name}</td>
                  <td>{patient.age}</td>
                  <td>{patient.gender}</td>
                  <td>{patient.address}</td>
                  <td>{patient.contact}</td>
                  <td>{patient.wardNumber}</td>
                  <td>
                    <span className={`badge ${patient.status === "Admitted" ? "bg-success" : "bg-secondary"}`}>
                      {patient.status}
                    </span>
                  </td>
                  <td>{new Date(patient.createdAt).toLocaleDateString()}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="8" className="text-center">No patients found</td>
              </tr>
            )}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default Dashboard;
